export const getIcon = (id) => {
  return icons.find((icon) => {
    return icon.id === id
  }).path
}

export const getCover = (id) => {
  const data = icons.find((icon) => {
    return icon.id === id
  })
  return data.cover
}
export const getDay = (id) => {
  return day.find((days) => {
    return days.day === id
  }).dayName
}

